        print(self.graph)

    def process_path(self, path):
        stack = [path]
        for i in range(len(path) - 1):
            curr = stack.pop()
            new = stack.append(curr[:])
            new.extend(curr[1:])
            new.extend([curr[0]] * curr[1])
        return new

    def get_all_paths(self, start, end, path=[]):
        if start not in self.graph:
            return path
        if end not in self.graph:
            return []
        return self.get_all_paths(start, self.process_path(path + [start]), path)

